<script lang="ts">
import { ref, Ref, watch } from 'vue'

interface Props {
  fill?: string
}
export default {
  name: 'Logo',
  props: {
    fill: {
      type: String,
      default: 'text-gray-900'
    }
  },
  setup(props: Props) {
    const color: Ref<Props['fill']> = ref(props.fill)
    watch(
      () => props.fill,
      (newFill: Props['fill']) => {
        color.value = newFill
      }
    )

    return {
      color
    }
  }
}
